// import React from 'react';
// import './App.css';
// import ProfileCard from './components/ProfileCard';

// function App() {
//   return (
//     <div className="App">
//       {/* ... */}
//       <section className="features">
//         <ProfileCard name="Nguyễn Văn A" title="Frontend Dev" />
//         <ProfileCard name="Trần Thị B" title="UI/UX Designer" />
//       </section>
//     </div>
//   );
// }

// export default App;

/*
  Personal Profile Web Application
  Built with React and Tailwind CSS
  To use this, scaffold your project with Create React App or Vite,
  install Tailwind CSS and apply the config as usual.
*/

import React from 'react';

const Navbar = () => (
  <nav className="flex justify-between items-center py-6 px-8 bg-white shadow-md">
    <h1 className="text-2xl font-bold">Your Name</h1>
    <ul className="flex space-x-6">
      <li><a href="#about" className="hover:text-blue-500">About</a></li>
      <li><a href="#projects" className="hover:text-blue-500">Projects</a></li>
      <li><a href="#contact" className="hover:text-blue-500">Contact</a></li>
    </ul>
  </nav>
);

const Hero = () => (
  <section className="flex flex-col items-center justify-center h-screen bg-gray-50">
    <h2 className="text-5xl font-extrabold mb-4">Hello, I’m Your Name</h2>
    <p className="text-xl text-gray-600">A passionate developer specializing in React and Web Development.</p>
  </section>
);

const About = () => (
  <section id="about" className="py-20 px-8 bg-white">
    <h3 className="text-3xl font-semibold mb-6">About Me</h3>
    <p className="text-gray-700 leading-relaxed max-w-3xl">
      {/* Replace this text with your bio. E.g.: */}
      I’m a frontend developer with experience in building responsive web applications using React, Tailwind CSS, and modern JavaScript frameworks. I love creating clean, user-friendly interfaces and learning new technologies.
    </p>
  </section>
);

const Projects = () => (
  <section id="projects" className="py-20 px-8 bg-gray-50">
    <h3 className="text-3xl font-semibold mb-6">Projects</h3>
    <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
      {/* Example Project Card */}
      <div className="p-6 bg-white rounded-2xl shadow">
        <h4 className="text-2xl font-bold mb-2">Project Title</h4>
        <p className="text-gray-600 mb-4">Short description of the project, tech stack, and role.</p>
        <a href="#" className="text-blue-500 hover:underline">View on GitHub</a>
      </div>
      {/* Add more project cards as needed */}
    </div>
  </section>
);

const Contact = () => (
  <section id="contact" className="py-20 px-8 bg-white">
    <h3 className="text-3xl font-semibold mb-6">Contact Me</h3>
    <form className="max-w-md mx-auto">
      <div className="mb-4">
        <label className="block text-gray-700 mb-2">Name</label>
        <input type="text" className="w-full px-4 py-2 border rounded-lg" placeholder="Your Name" />
      </div>
      <div className="mb-4">
        <label className="block text-gray-700 mb-2">Email</label>
        <input type="email" className="w-full px-4 py-2 border rounded-lg" placeholder="Your Email" />
      </div>
      <div className="mb-4">
        <label className="block text-gray-700 mb-2">Message</label>
        <textarea className="w-full px-4 py-2 border rounded-lg" rows="4" placeholder="Your Message"></textarea>
      </div>
      <button type="submit" className="px-6 py-3 bg-blue-500 text-white rounded-xl shadow hover:bg-blue-600">Send Message</button>
    </form>
  </section>
);

const Footer = () => (
  <footer className="py-6 bg-gray-800 text-white text-center">
    <p>&copy; {new Date().getFullYear()} Your Name. All rights reserved.</p>
  </footer>
);

export default function App() {
  return (
    <div className="font-sans antialiased text-gray-900">
      <Navbar />
      <Hero />
      <About />
      <Projects />
      <Contact />
      <Footer />
    </div>
  );
}
